description:
Tory Lane is looking to have a self portrait of her commissioned.She went to the wrong place though.She ended up with an art broker instead of with an artist.Well Tory is the kind of lady that gets what she wants and she wants the broker to paint her regardless of whether he has the right skills or not.Since he doesn't know how to paint on canvas Tory settles on having him paint her body with his cum.The broker is hesitant at first since he is a married man, but he can't say no once Tory gets her hands on him.

